description:
cat >> ~/.bashrc <<'EOF'
tapp() {
  (
    cd /home/revanth/tracking-status/app || { echo "Path not found"; return 1; }
    nohup npm start > nohup.out 2>&1 &
  )
  echo "Started t-app (log: /home/revanth/tracking-status/app/nohup.out)"
}

tapp-logs() {
  tail -f /home/revanth/tracking-status/app/nohup.out
}

tapp-stop() {
  pkill -f "node.*tracking-status|npm start" && echo "Stopped t-app"
}
EOF

# Reload your shell config
source ~/.bashrc
